import { Component } from "react";
import "./card.styles.css"

class Card extends Component{
    render(){
        const { name, image, email } = this.props;
        return(
        <div className="card-container">
            <h1>{name}</h1>
            <img src={image} alt="" />
            <p>{email}</p>
        </div>
        )
    }
}
export default Card;
